public class ComplexNumber\n{\n    private int a;\n    private int b;\n\n    public ComplexNumber(int a, int b)\n    {\n        this.a = a;\n        this.b = b;\n    }\n\n    public override int GetHashCode()\n    {\n        unchecked // Allow arithmetic overflow, ignore it\n        {\n            int hash = 17;\n            hash = hash * 31 + a.GetHashCode();\n            hash = hash * 31 + b.GetHashCode();\n            return hash;\n        }\n    }\n}